INSERT INTO `projects` VALUES (14,'Laboratory book(WPF)','2019-04-01','2019-09-10','<h3>Description</h3>\n<p>We used to store all data concerning our samples in a paper laboratory book, as every laboratory do. The chief of our laboratory came up with idea to create database of samples wich will be accessed remotely for each user of the laboratory book. The easy and fast solution was to put the samples data in the excel file strored in cloud. It was implemented immedeately and worked fine, however I decided to improve it because of the lack of some importaint features concerning data management and access. This inspired me to make a desctop client of the laboratory book</p>\n<h3>Used frameworks and programming languages</h3>\n<p style=\"text-indent: 0;\">C#(WPF), MySQL </p>','2019-09-20 11:09:41'),(15,'Laboratory book(ASP.Net Core MVC)','2019-08-01','2019-09-12','<h3>Description</h3>\n<p>This project is a continuation of the Laboratory Book(WPF) project. In order to access our samples database from any device I decided to create a web client which looks and feels similary to windows desktop application including dialog windows, pop-ups and seamless content loading. Web client supports all the features of the desktop laboratory book client. </p>\n<h3>Used frameworks and programming languages</h3>\n<p style=\"text-indent: 0;\">C#(ASP.NET core MVC), MySQL, JavaScript(JQuery), HTML, CSS </p>','2019-09-18 10:00:39'),(16,'Portfolio','2019-10-01','2019-09-12','<h3>Description</h3>\n<p>After a few years of coding I decided to organize my projects in a portfolio web app. It was an opprotunity to kill two birds with one shot &ndash; to get acquainted with a newly released .Net Core 3.0 and to play with Docker. I also tried to utilize some features of C# 8.0, where it was possible.  </p>\n<h3>Used frameworks and programming languages</h3>\n<p style=\"text-indent: 0;\">C#(ASP.NET core MVC), MySQL, JavaScript, HTML, CSS </p>','2019-09-12 10:58:24'),(17,'Lightbulb shutter','2018-10-01','2019-09-13','<h3>Description</h3>    \n<p>In the Instirute of Physics our department works with photo-electrochemical device for measurement of cataylsts photo-activity. The device consists of elecrochemical cell, potentiostat and lightbulb with defined optical spectrum. Our colegue asked me to automate light bulb shutter which was previously operated manualy. The goal was to  make the electical device for manipuation with step motor, which was responsible for closing/opening bulb shutter during a given period of time at some given frequency and off/on time. The device was connected via usb cable to the computer and contolled by program written in C#(WPF). </p>\n<h3>Used frameworks and programming languages</h3>\n<p style=\"text-indent: 0;\">C#(WPF), Arduino C</p>','2019-09-21 15:19:46'),(18,'Step motor control unit','2019-05-01','2019-09-13','<h3>Description</h3>\n<p> The goal was to create electric device for control of the step motor. The step motor was used for manipulation with sample holder inside the vacuum chamber. The step motor controller supports continuous rotation in both direction and changing the position at given frequency and angle. </p>\n<h3>Used frameworks and programming languages</h3>\n<p style=\"text-indent: 0;\">Arduino C</p>','2019-09-20 14:39:55'),(19,'MKS MF-1 control unit','2018-07-01','2019-09-14','<h3>Description</h2>\n   <p>Previously in our laboratory we used a very simple control unit for mass flow controllers. It basically consisted of potentiometers, power supply and digital voltmeters. The project goal was to construct and program more advanced control unit. The new one recalculates voltage values of the flow rate into the flow rate units, remembers the state after swithing off and shows both actual flow and setpoint values.</p>\n    <h3>Used frameworks and programming languages</h3>\n    <p style=\"text-indent: 0;\">C#(WPF), MySQL </p>','2019-09-14 11:08:01');
