INSERT INTO `projects_html` VALUES (14,'<div class=\"project-container\">\r\n    <div class=\"project-text\">\r\n        <h3>Description</h3>\r\n        <p>We used to store all data concerning our samples in a paper laboratory book, as every laboratory do. The\r\n            chief of our laboratory came up with idea to create database of samples wich will be accessed remotely for\r\n            each user of the laboratory book. The easy and fast solution was to put the samples data in the excel file\r\n            strored in cloud. It was implemented immedeately and worked fine, however I decided to improve it because of\r\n            the lack of some importaint features concerning data management and access. This inspired me to make a\r\n            desktop client of the laboratory book </p>\r\n        <p>To protect the samples database authorisation and authentication was implemented. Users passwords are\r\n            \"salted\" and stored in encrypted format. Different policies are used for users with different permissions\r\n            when they access the database. User class has four subclasses: Guest, Laborant, Moderator and Administer.\r\n            Moderator and Administer classes implement IAdvancedUser interface which grant additional functionality for\r\n            operation with users and database.</p>\r\n        <p>Data are visualised by means of DataGrid. Columns type (TextColumn or CombobBoxColumn) are resolved during\r\n            DataGrid authogeneration. Each change in DataGrid is instantly synchronised with database.\r\n        </p>\r\n        <p>The web client of the laboratory book created introduced later. The link is given in \"Links\" section below.\r\n            U can use login \"TestUser\" and password \"qwert1234\" to test the application. Screenshoots of the working\r\n            application are given below.</p>\r\n        <h3>Highlights</h3>\r\n        <ul>\r\n            <li>Plain SQL for interaction with database.</li>\r\n            <li>MVVM pattern was implemented where it was necessary.</li>\r\n            <li>A lot of multithreading and asynchronous programming.</li>\r\n            <li>Legacy .NET framework.</li>\r\n        </ul>\r\n        <h3>Links</h3>\r\n        <div class=\"project-link-container\">\r\n            <a target=\"_blank\" href=\"\">GitHub</a>\r\n            <a target=\"_blank\" href=\"\">Web app</a>\r\n        </div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/Projects/14/images/1.jpg\" alt=\"login\">\r\n        <div class=\"project-image-caption\">Login window</div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/Projects/14/images/2.jpg\" alt=\"Laboratory book\">\r\n        <div class=\"project-image-caption\">Laboratory book window</div>\r\n    </div>\r\n</div>'),(15,'<div class=\"project-container\">\r\n    <div class=\"project-text\">\r\n        <h3>Description</h3>\r\n        <p>This project is a continuation of the Laboratory Book(WPF) project. In order to access our samples database from any device I decided to create a web client which looks and feels similary to windows desktop application including dialog windows, pop-ups and seamless content loading. For this purposes \"JQuery UI\" javascript library was utilized. It has a rich set of controls including dialog window, progress bar and a lot more. Although client side is based on the pure javascript and JQuery, the UI follows a model which is close to SPA. The application compleatly reload only once after selection of the laboratory book instance. Web app architecture combines MVC and  Web API models. </p>\r\n        <p>U can use login \"TestUser\" and password \"qwert1234\" to test the web application. Screenshoots of the working application are given below.</p>\r\n        <h3>Highlights</h3>\r\n        <ul>\r\n            <li>Plain SQL for interaction with database.</li>\r\n            <li>A lot of pure javascript and JQuery.</li>\r\n            <li>\"JQuery UI\" javascript library for dialog windows</li>\r\n            <li>\"JQuery Datatable\" javascript library for data visualisation</li>\r\n            <li>\"JQuery Toaster\" for snackbars</li>\r\n            <li>Supports all the features of the desktop laboratory book client.</li>\r\n        </ul>\r\n        <h3>Links</h3>\r\n        <div class=\"project-link-container\">          \r\n            <a target=\"_blank\" href=\"\">GitHub</a>            \r\n            <a target=\"_blank\" href=\"https://laboratorybook.appspot.com/\">Web app</a>\r\n        </div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/projects/15/images/1.jpg\" alt=\"login\">\r\n        <div class=\"project-image-caption\">Login page</div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/projects/15/images/2.jpg\" alt=\"select\">\r\n        <div class=\"project-image-caption\">Laboratory book selection page</div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/projects/15/images/3.jpg\" alt=\"Ui\">\r\n        <div class=\"project-image-caption\">UI of the web application</div>\r\n    </div>\r\n</div>'),(16,'<div class=\"project-container\"> \r\n    <div class=\"project-text\">\r\n       <h3>Description</h3>\r\n        <p>After a few years of coding I decided to organize my projects in a portfolio web app. It was an opprotunity to kill two birds with one shot &ndash; to get acquainted with a newly released .Net Core 3.0 and to play with Docker. I also tried to utilize some features of C# 8.0, where it was possible.</p>\r\n        <p>My intention was to make the portfolio neat, with easy navigation and snappy. The \"snappines\" was achieved by using AJAX requests and simulaneous faiding animation. In most cases the request will be processed before animation is finished which resuts in a seamless content transition.</p>\r\n        <p>If you click on the mail button in the navigation bar the modal form for e-mail sending will pop up. The e-mails delivery is implemented by means of SMPT client behind the scenes. I will appriciate if you use it ?.</p>\r\n        <h3>Highlights</h3>\r\n        <ul>\r\n          <li>Entity Framework for interaction with projects database.</li>\r\n          <li>Projects data including html and images are stored in database</li>\r\n          <li>Swagger for web api tests.</li>                \r\n          <li>Automatic css and js minimization using NUglify.</li>\r\n          <li>Hosted service which automatically deletes old files in wwwroot/projects directory.</li>\r\n          <li>Deployed in Docker.</li>               \r\n        </ul>              \r\n        <h3>Links</h3>   \r\n        <div class=\"project-link-container\">               \r\n            <a href=\"\">GitHub</a>\r\n        </div>   \r\n    </div>\r\n</div>     \r\n'),(17,'<div class=\"project-container\">\r\n    <div class=\"project-text\">\r\n        <h3>Description</h3>\r\n        <p>\r\n            In the Instirute of Physics our department works with photo-electrochemical device for measurement of\r\n            cataylsts photo-activity. The device consists of elecrochemical cell, potentiostat and lightbulb with\r\n            defined optical spectrum. Our colegue asked me to automate light bulb shutter which was previously operated\r\n            manualy. The goal was to make the electical device for manipuation with step motor, which was responsible\r\n            for closing/opening bulb shutter during a given period of time at some given frequency and off/on time. The\r\n            device was connected via usb cable to the computer and contolled by program written in C#(WPF).\r\n        </p>\r\n        <h3>Highlights</h3>\r\n        <ul>\r\n            <li>Hardware soldering and programming</li>\r\n            <li>First experiments with WPF.</li>\r\n            <li>Serial port communication.</li>\r\n            <li>Abuse of events instead of MVVM implementation</li>\r\n            <li>Legacy .NET framework.</li>\r\n        </ul>\r\n        <h3>Links</h3>\r\n        <div class=\"project-link-container\">\r\n            <a target=\"_blank\" href=\"\">GitHub</a>\r\n        </div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/Projects/17/images/1.jpg\" alt=\"login\">\r\n        <div class=\"project-image-caption\">Application main window</div>\r\n    </div>\r\n    <div class=\"project-text\">\r\n        <p>\r\n            WPF program connects to the device automatically during the initialisation phase. Before use of the device\r\n            user should adjust the pipeline of cycles which will go one by one in defined order. Each cycle has\r\n            three parameters: off time, on time and duration. Adjusted experiment parameters should be pushed to Arduino\r\n            before starting the experiment. Data are splited into bytes befor sending.\r\n        </p>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/Projects/17/images/2.jpg\" alt=\"login\">\r\n        <div class=\"project-image-caption\">Step motor contoller</div>\r\n    </div>\r\n    <div class=\"project-text\">\r\n        <p>\r\n            For manipulation with shutter we used low-power step motor which was operated at the thrice higher power\r\n            value comparing to the value given in its manual to be able to lift the shutter. Step motor was operatied in\r\n            unipolar half-step mode. The device was powered by 5V/1A adapter and voltage on the step motor was increased\r\n            using boost converter.\r\n        </p>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <iframe src=\"https://www.youtube.com/embed/GUW7sfg7zjY\">\r\n        </iframe>\r\n        <div class=\"project-image-caption\">Shutter at work</div>\r\n    </div>\r\n</div>'),(18,'<div class=\"project-container\">\r\n    <div class=\"project-text\">\r\n        <h3>Description</h3>\r\n        <p>The goal was to create electric device for control of the step motor. The step motor was used for\r\n            manipulation with sample holder inside the vacuum chamber. The step motor controller supports continuous\r\n            rotation in both directions and changing the position at given frequency and angle, given amount of times.\r\n        </p>\r\n        <p>Step motor is operated in a bipolar mode. The step motor driver based on L298N integrated circuit is\r\n            responsible for power amplification. The dissipated power of the step motor is about 10&nbsp;W. Pulse\r\n            generation is provided by Arduino Nano board. The visualisation of setting is implemented using 4x16 LCD\r\n            display. </p>\r\n        <h3>Highlights</h3>\r\n        <ul>\r\n            <li>Rotation speed and direction adjustment</li>\r\n            <li>Operation in stepping mode: table is periodically rotated by a given angle </li>\r\n            <li>Involved designing, soldering, assembling and programming </li>\r\n        </ul>\r\n        <h3>Links</h3>\r\n        <div class=\"project-link-container\">\r\n            <a target=\"_blank\" href=\"\">GitHub</a>\r\n        </div>\r\n    </div>\r\n    <div class=\"project-container-image\">\r\n        <img src=\"/projects/18/images/1.jpg\">\r\n        </img>\r\n        <div class=\"project-image-caption\">Login page</div>\r\n    </div> \r\n</div>'),(19,'<div class=\"project-container\">               \r\n    <div class=\"project-text\">\r\n        <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Distinctio voluptates quis provident debitis voluptatem inventore odio modi non vel nesciunt \r\n        laudantium ipsam, accusantium deleniti porro, aliquid esse assumenda! Similique ipsum eius pariatur assumenda ea mollitia nostrum fugit, optio culpa minus voluptatibus in, dicta illo. Suscipit delectus odio accusamus. Dicta sit enim autem quos culpa maior